import './App.css';
import {Routes, Route, BrowserRouter} from "react-router-dom"
import Home from './Home';
function App() {
  return (
    <div className="App">
      <BrowserRouter>
      </BrowserRouter>
     <Routes>
      <Route path='/' Component={Home} />
     </Routes>
    </div>
  );
}

export default App;
